const TwoButton: React.FC<any> = () => {
  const [counter1, setCounter1] = useState(0)
  const [counter2, setCounter2] = useState(0)

  return (
    <>
      <button>Button1 ({counter1})</button>
      <button>Button2 ({counter2})</button>
    </>
  )
}

export default TwoButton
